System.register([],(function(e){return{execute:function(){e({fixedLayoutTip:"Calculer automatiquement l’ordre des onglets d’élément dans les mises en page fixes",fixedLayoutDesc:"Pour les widgets dans des pages plein écran ou des mises en page fixes (par exemple, Volet fixe, Fiche, Liste, etc.), si cette option est activée, l’ordre des onglets est calculé automatiquement en fonction des positions de sorte qu’il soit synchronisé avec l’ordre visuel pour une meilleure expérience en termes d’accessibilité. Cette option affecte la superposition des widgets, il est donc recommandé de déplacer certains éléments vers l’avant ou l’arrière pour obtenir les résultats souhaités."})}}}));